import React from 'react';
import ActivityCard from '../components/ActivityCard';

const dummyActs = [
  { id:1, title:'Paseo Park', description:'Encuentro en el parque central', time:'2025-05-01 10:00' },
  { id:2, title:'Ruta Campo', description:'Senderismo con mascotas', time:'2025-05-03 09:00' },
];

export default function Activities() {
  return (
    <div>
      <h2 className="mb-4">Actividades</h2>
      <div className="row">
        {dummyActs.map(act => (
          <div className="col-md-6 mb-3" key={act.id}>
            <ActivityCard activity={act} />
          </div>
        ))}
      </div>
    </div>
  );
}
